css:
.grunt-runner-resizer {
  position: relative;
  overflow: hidden;
  height: 130px;
  width: 100%;
  z-index: 2;
}
.grunt-runner-resizer .grunt-runner-resizer-handle {
  cursor: n-resize;
  height: 5px;
}
.grunt-runner-results {
  border-top: 0;
  height: 100%;
  padding: 0px !important;
}
.grunt-runner-results .grunt-panel-heading {
  padding: 8px !important;
  float: left;
}
.grunt-runner-results .grunt-panel-heading:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 10pt;
  content: "\f052";
  width: 15pt;
  vertical-align: -webkit-baseline-middle;
}
.grunt-runner-results .grunt-panel-heading[data-status=loading]:before {
  content: "\f09e";
}
.grunt-runner-results .grunt-panel-heading[data-status=ready]:before {
  color: green;
  content: "\f03a";
}
.grunt-runner-results .grunt-panel-heading[data-status=error]:before {
  color: red;
  content: "\f02d";
}
.grunt-runner-results .grunt-panel-heading .btn-group {
  width: 100px;
}
.grunt-runner-results .grunt-panel-heading .btn-group .btn {
  width: 100%;
  margin-top: 8px;
}
.grunt-runner-results.closed .btn-group,
.grunt-runner-results.closed .btn {
  width: auto !important;
}
.grunt-runner-results .panel-body {
  max-height: calc( 100% );
  overflow-y: scroll;
}
.grunt-runner-results .panel-body li {
  padding: 3px 0px;
  margin: 0px;
  font-size: 9pt;
  line-height: 12pt;
  white-space: normal;
  border-bottom: solid 1px rgba(0, 0, 0, 0.5);
  font-family: monospace;
}
.grunt-runner-results .panel-body li .yellow {
  color: yellow;
}
.grunt-runner-results .panel-body li .red {
  color: #E20000;
}
.grunt-runner-results .panel-body li .green {
  color: green;
}
.grunt-runner-results .panel-body li .cyan {
  color: cyan;
}
.grunt-runner-results .panel-body li .gray {
  color: gray;
}
.grunt-runner-results .panel-body li .strong {
  font-weight: 700;
}
.grunt-runner-results .panel-body li .underline {
  text-decoration: underline;
}
.grunt-runner-results.closed .panel-body {
  display: none;
}
